  const isPc = useMediaQuery({
    query: "(min-width: 768px)"
  })
  const isMobileMain = isPc ? "웹페이지" : <Mainpage />;

  return (
    <>
      <FontAwesomeIcon icon={faCoffee} />
      {/* 메뉴바 컴포넌트에 Link써서 하자 */}
      {/* {isMobileMain} */}
    </>
  );
}

function hello() {
